description:
Kubuntu 14.04 LTE 64-bit

April, 2014



Ali Jawad has announced the release of Ubuntu GNOME 14.04, the latest update of this official Ubuntu flavour featuring the vanilla GNOME 3.10 desktop: &quot;The Ubuntu GNOME team is proud and happy to announce the release of Ubuntu GNOME 14.04 LTS. Ubuntu GNOME is an official flavour of Ubuntu, featuring the GNOME desktop environment. Ubuntu GNOME is a mostly pure GNOME desktop experience built from the Ubuntu repositories. This is our very first long-term support (LTS) version. Features: Most of GNOME 3.10 is now included, the few missing bits of 3.10 are available in PPA; with GNOME 3.10 comes enhanced support for online accounts, and some general optimization of the user interface; a set of 10 new high-quality wallpapers are included; GNOME Classic session is included....&quot;
